import React from "react"

function Project(props){

    const skills = props.map(function(skill){
        return <li key={skill}>
            {skill}
        </li>
    });

    const image = require("../portfolio_assets/FixGradKappa2.png")

    if(props.htmlsetting.pos == "l"){
        return(
            <div className={props.htmlsetting.container}>
                <img src={image} alt="img" className={props.htmlsetting.icon}></img>
                <article>
                    <h2 className={props.htmlsetting.h2}>{props.project.caption}</h2>
                    <p className={props.htmlsetting.p}>{props.project.text}</p>
                    <br></br>
                    <p className={props.htmlsetting.p} style={{display: props.project.url_android ? "block" : "none"}}>
                        Android: <a href={props.project.url_android} className="tradedex_link">Link</a>
                        <br></br>
                        iOS: <a href={props.project.url_ios} className="tradedex_link">Link</a>
                        <br></br><br></br>
                    </p>
                    <ul className={props.htmlsetting.ul}>
                        {skills}
                    </ul>
                </article>
                <p></p>
            </div>
        )
    }
    else{
        return(
            <div className={props.htmlsetting.container}>
                <p></p>
                <article>
                    <h2 className={props.htmlsetting.h2}>{props.project.caption}</h2>
                    <p className={props.htmlsetting.p}>{props.project.text}</p>
                    <br></br>
                    <ul className={props.htmlsetting.ul}>
                        {skills}
                    </ul>
                </article>
                <img src={image} alt="img" className={props.htmlsetting.icon}></img>
            </div>
        )
    }
}

export default Project
